#from https://stackoverflow.com/questions/4798654/modular-multiplicative-inverse-function-in-python#9758173
def egcd(a, b):
    if a == 0:
        return (b, 0, 1)
    else:
        g, y, x = egcd(b % a, a)
        return (g, x - (b // a) * y, y)
		
#from https://stackoverflow.com/questions/4798654/modular-multiplicative-inverse-function-in-python#9758173
def modinv(a, m):
    g, x, y = egcd(a, m)
    if g != 1:
        raise Exception('modular inverse does not exist')
    else:
        return x % m
		
t1=c1*(n2*n3)*modinv(n2*n3,n1)
