t3=c3*(n1*n2)*modinv(n1*n2,n3)

c=(t1+t2+t3)%(n1*n2*n3)

#from http://python.6.x6.nabble.com/cube-root-tp1733498p1733529.html
def root3rd(x):
    y, y1 = None, 2
    while y!=y1:
        y = y1
        y3 = y**3
        d = (2*y3+x)
        y1 = (y*(y3+2*x)+d//2)//d
    return y

